          "message": "chore(deps): update rust crate jiff to v0.1.10 (#692)\n\n[![Mend\nRenovate](https://app.renovatebot.com/images/banner.svg)](https://renovatebot.com)\n\nThis PR contains the following updates:\n\n| Package | Type | Update | Change |\n|---|---|---|---|\n| [jiff](https://togithub.com/BurntSushi/jiff) | workspace.dependencies\n| patch | `0.1.8` -> `0.1.10` |\n\n---\n\n### Release Notes\n\n<details>\n<summary>BurntSushi/jiff (jiff)</summary>\n\n###\n[`v0.1.10`](https://togithub.com/BurntSushi/jiff/blob/HEAD/CHANGELOG.md#0110-2024-08-23)\n\n[Compare\nSource](https://togithub.com/BurntSushi/jiff/compare/0.1.9...0.1.10)\n\n\\===================\nThis release features a small bug fix where Jiff will detect an IANA\ntime\nzone identifier in some cases where it wouldn't before. While Jiff would\npreviously read the symlink metadata on `/etc/localtime` by default to\ndiscover\nthe system configured time zone on Unix systems, it *wouldn't* do so\nwhen\n`TZ=/etc/localtime`. There's really no reason not to, so this release of\nJiff\nis fixed to use symlink sniffing on file paths provided by thw `TZ`\nenvironment\nvariable.\n\nBug fixes:\n\n-   [#&#8203;113](https://togithub.com/BurntSushi/jiff/issues/113):\nWhen `TZ=/etc/localtime`, use symlink metadata to detect IANA\nidentifier.\n\n###\n[`v0.1.9`](https://togithub.com/BurntSushi/jiff/blob/HEAD/CHANGELOG.md#019-2024-08-23)\n\n[Compare\nSource](https://togithub.com/BurntSushi/jiff/compare/0.1.8...0.1.9)\n\n\\==================\nThis release introduces new options for controlling the precision\nof fractional seconds when printing `Zoned`, `Timestamp`,\n`civil::DateTime` or `civil::Time` values. This is principally exposed\nvia `jiff::fmt::temporal::DateTimePrinter::precision`, but it's also\navailable via the standard library's formatting machinery. For example,\nif `zdt` is a `jiff::Zoned`, then `format!(\"{zdt:.6}\")` will format\nit into a string with microsecond precision, even if its fractional\ncomponent is zero.\n\nEnhancements:\n\n-   [#&#8203;92](https://togithub.com/BurntSushi/jiff/issues/92):\nSupport setting the precision of fractional seconds when printing\ndatetimes.\n\n</details>\n\n---\n\n### Configuration\n\n📅 **Schedule**: Branch creation - At any time (no schedule defined),\nAutomerge - At any time (no schedule defined).\n\n🚦 **Automerge**: Enabled.\n\n♻ **Rebasing**: Whenever PR becomes conflicted, or you tick the\nrebase/retry checkbox.\n\n🔕 **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend\nRenovate](https://www.mend.io/free-developer-tools/renovate/). View the\n[repository job log](https://developer.mend.io/github/spiraldb/vortex).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiIzOC4yNi4xIiwidXBkYXRlZEluVmVyIjoiMzguMjYuMSIsInRhcmdldEJyYW5jaCI6ImRldmVsb3AiLCJsYWJlbHMiOltdfQ==-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
